import React from "react";
import Card from "antd/es/card/Card";

// const { Meta } = Card;

const ProductCard = () => {
   return (
      <Card
      hoverable
      style={{ width: 240 }}
      cover={
         <img
            alt="example"
            src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png"
         />
      }
      >
      <p style={{width: '100%', color: '#4D4D4D', fontSize: 14, fontFamily: 'Poppins', fontWeight: '400', lineHeight: 21, wordWrap: 'break-word'}}>Green Apple</p>
      </Card>
   );
};

export default ProductCard;
